import React, { Component } from 'react';
import axios from 'axios';
import { Sidebar, InputItem, DropdownItem, Icon, Item, Logo, LogoText } from 'react-sidebar-ui'
import {
  Row, Col, Card, CardHeader, CardBody, FormGroup, Label, Form, Input, InputGroup, InputGroupAddon,
  InputGroupText, Button, Collapse, FormText, Dropdown, DropdownToggle, DropdownMenu, ListGroup, ListGroupItem,
  Modal, ModalBody, ModalFooter, ModalHeader, CardFooter
} from "reactstrap";

const url = (process.env.REACT_APP_DOMAIN) + ':' + (process.env.REACT_APP_PORT) + '/';

class TestsPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      accordion: [],
      testTakeAnswer: {
          title: "",
          test_questions: [{
              title:"",
              test_question_answers:[]
          }]
      },
    };

    this.getTestTakeAnswer = this.getTestTakeAnswer.bind(this)
    this.getTest = this.getTest.bind(this);
  }

  componentDidMount() {
    this.getTest()
  }

  getTest() {
    const { id } = this.props.match.params;
    axios({
      method: 'get',
      url: url + 'test/' + id,
    }).then((response) => {
      this.setState({ test: response.data })
      this.generateAccordion()
    }, (error) => {
      console.log(error);
    });
  }

  getTestTakeAnswer(){
    const { id } = this.props.match.params;
    axios({
      method: 'get',
      url: url + 'test_take_answer/' + id,
    }).then((response) => {
      this.setState({ testTakeAnswer: response.data })
     // this.getTest()
    }, (error) => {
      console.log(error);
    });
  }

  render() {
    return (
        <Card style={{ backgroundColor: "whiteSmoke" }}>
        <CardHeader>
            <h2>Test title</h2>
        </CardHeader>
        <CardBody>
          <Table responsive>
            <thead>
            <tr>
              <th>#</th>
              <th>Question</th>
              <th>Answer</th>
              <th>Correct answer</th>
              <th>Score</th>
            </tr>
            </thead>
            <tbody>
            {(this.state.students).map((student, index) =>
            <tr key={student.id}>
              <td>{index + 1}</td>
              <td>{student.name}</td>
              <td>{student.last_name}</td>
              </tr>
              )}
            </tbody>
          </Table>
        </CardBody>
      </Card>
    );
  }
}

export default TestsPage;
